import React from "react";
import {useState} from 'react';
import './index.css';


const App = ()=>{
    const current_time = new Date().toLocaleTimeString();
    const [cTime, setCTime] = useState(current_time);

    const updateCurrentTime = ()=>{
        const current_time = new Date().getLocaleTimeString();
        setCTime(current_time);
    }

    return (
        <>
            <h1 className="heading1">{cTime}</h1>   
        </>
    )
}

export default App;
